import React from "react";
import logo from "./logo.svg";
import "./App.css";

import profile from "./profile.jpg";

import BioHeader from "./components/BioHeader";

function App() {
  return (
    <div className="App">
      <BioHeader photo={profile}></BioHeader>
    </div>
  );
}

export default App;
